import { LoginService } from "../login.service";
import NoCaptcha from "./no-captcha";
import AccountAgreement from '@/views/biz-modals/account/agreement';
import { ruleOptions } from "./login.config";
import { PatternService } from '@/services/pattern.service';
export default {
  bem: {
    loginUser: 'page-login-user'
  },
  name: 'LoginUser',
  components: {
    NoCaptcha: NoCaptcha
  },
  serviceInject: function serviceInject() {
    return {
      loginService: LoginService,
      pattern: PatternService
    };
  },
  rxState: function rxState() {
    return {
      loading: this.loginService.loading$
    };
  },
  mounted: function mounted() {
    var name = localStorage.getItem('UserAccountForFind') || '';
    this.form.setFieldsValue({
      name: name
    });
  },
  data: function data() {
    var form = this.$stForm.create();
    var decorators = form.decorators(ruleOptions);
    return {
      form: form,
      decorators: decorators,
      thirdLogins: ['alipay', 'wechat', 'weibo', 'qq'],
      trunPage: false
    };
  },
  modals: {
    AccountAgreement: AccountAgreement
  },
  computed: {},
  methods: {
    clickAgreement: function clickAgreement() {
      this.$modalRouter.push({
        name: 'account-agreement',
        props: {},
        on: {}
      });
    },
    login: function login() {
      var _this = this;

      this.form.validate().then(function (values) {
        _this.$emit('login', values);
      });
    },
    onClickFindPassword: function onClickFindPassword() {
      var data = this.form.getFieldsValue();
      localStorage.setItem('UserAccountForFind', data.name);
      window.open('/account/find', 'blank');
    },
    onClickThirdChange: function onClickThirdChange(key) {
      this.$emit('third', key);
    }
  }
};
